{# --- Initialize and calculate balance first --- #}
{% set ns = namespace(total_amount=0, total_received=0) %} 
{% set today = frappe.utils.getdate() %}

{# Get customer details #}
{% set customer_doc = frappe.get_doc("Customer", doc.customer) %}

{# Get all Sales Invoices for the period #}
{% set invoices = frappe.get_all("Sales Invoice",
    filters={
        "customer": doc.customer,
        "docstatus": 1,
        "posting_date": ["between", [doc.from_date, doc.to_date]]
    },
    fields=["name", "posting_date", "grand_total", "outstanding_amount"],
    order_by="posting_date asc") %}

{# Calculate totals #}
{% for inv in invoices %}
    {% set ns.total_amount = ns.total_amount + inv.grand_total %}
    {% set paid = inv.grand_total - inv.outstanding_amount %}
    {% set ns.total_received = ns.total_received + paid %}
{% endfor %}

<style>
    @media print {
        /* Ledger table can break across pages */
        .ledger-table {
            page-break-inside: auto;
        }
        
        .ledger-table thead {
            display: table-header-group; /* Repeat column headers on each page */
        }
        
        /* Force footer to bottom of every page */
        .page-footer {
            position: fixed;
            bottom: 0;
            left: 0;
            right: 0;
            page-break-after: avoid;
        }
        
        /* Add space at bottom for footer */
        body {
            margin-bottom: 100px;
        }
    }
    
    .dotted-line {
        border-top: 2px dotted #000;
        margin: 10px 0;
    }
    
    /* Remove all borders except header borders */
    .ledger-table {
        border-collapse: collapse;
        border: none;
    }
    
    .ledger-table td {
        border: none !important;
        padding: 8px;
        white-space: nowrap;
    }
    
    .ledger-table th {
        border-left: none !important;
        border-right: none !important;
        border-top: 1px solid #000 !important;
        border-bottom: 1px solid #000 !important;
        padding: 8px;
        white-space: nowrap;
    }
    
    /* Prevent wrapping on all cells */
    .no-wrap {
        white-space: nowrap;
    }
</style>

<div class="page-header">
    <table style="width: 100%; margin-bottom: 20px;" border="0">
        <tr>
            <td style="width: 50%; vertical-align: top;">
                <div style="line-height: 1.4;">
                    <strong>SurgiShop</strong><br>
                    19235 N US Highway 41<br>
                    Lutz, FL 33549<br>
                    +18557202285<br>
                    accounting@surgishop.com<br>
                    www.SurgiShop.com
                </div>
                
                <h3 style="margin: 10px 0;">Transaction Statement</h3>
                
                <div style="line-height: 1.4;">
                    <strong>TO</strong><br>
                    {{ customer_doc.customer_name }}<br>
                    {% if customer_doc.customer_primary_contact %}
                        {% set contact = frappe.get_doc("Contact", customer_doc.customer_primary_contact) %}
                        {{ contact.first_name }} {{ contact.last_name }}<br>
                    {% endif %}
                    {% if customer_doc.customer_primary_address %}
                        {% set address = frappe.get_doc("Address", customer_doc.customer_primary_address) %}
                        {{ address.address_line1 }}<br>
                        {% if address.address_line2 %}{{ address.address_line2 }}<br>{% endif %}
                        {{ address.city }}, {{ address.state }} {{ address.pincode }} {{ address.country }}
                    {% endif %}
                </div>
            </td>
            
            <td style="width: 50%; vertical-align: top;">
                <div style="text-align: right; margin-bottom: 20px;">
                    <img src="data:image/png;base64," style="max-width: 112px; max-height: 45px; width: auto; height: auto;" alt="Logo">
                </div>
                
                <div style="padding-top: 115px; line-height: 1.4;">
                    <table style="width: 100%; border-collapse: collapse;">
                        <tr>
                            <td style="text-align: right; padding-right: 10px; padding: 0;"><strong>DATE</strong></td>
                            <td style="text-align: left; padding: 0;">{{ doc.posting_date or today }}</td>
                        </tr>
                    </table>
                </div>
            </td>
        </tr>
    </table>
</div>

<table class="ledger-table" style="width: 100%;">
    <thead style="background-color: #d3d3d3;">
        <tr>
            <th style="color: #000000; font-weight: bold; width: 15%;">DATE</th>
            <th style="color: #000000; font-weight: bold; width: 55%;">DESCRIPTION</th>
            <th style="color: #000000; font-weight: bold; width: 15%;">AMOUNT</th>
            <th style="color: #000000; font-weight: bold; width: 15%;">RECEIVED</th>
        </tr>
    </thead>
    <tbody>
        {# Invoice Entries #}
        {% for inv in invoices %}
            {% set paid = inv.grand_total - inv.outstanding_amount %}
            <tr>
                <td class="no-wrap">{{ inv.posting_date }}</td>
                <td>Invoice {{ inv.name }}</td>
                <td class="no-wrap">{{ "{:,.2f}".format(inv.grand_total) }}</td>
                <td class="no-wrap">{{ "{:,.2f}".format(paid) }}</td>
            </tr>
        {% endfor %}
        
        {# Dotted line separator #}
        <tr>
            <td colspan="4" style="padding: 0; border: none !important;">
                <div class="dotted-line"></div>
            </td>
        </tr>
        
        {# Total row #}
        <tr style="font-weight: bold;">
            <td></td>
            <td></td>
            <td class="no-wrap">TOTAL AMOUNT:<br>$ {{ "{:,.2f}".format(ns.total_amount) }}</td>
            <td class="no-wrap">TOTAL RECEIVED:<br>$ {{ "{:,.2f}".format(ns.total_received) }}</td>
        </tr>
    </tbody>
</table>

<!-- Page Footer with Payment Info (repeats on every page) -->
<div class="page-footer">
    <!-- Payment information -->
    <div style="text-align: center; margin-top: 40px;">
        <p><strong>Pay your Invoice Online: Pay.SurgiShop.com</strong></p>
        <p>For more information please email Accounting@SurgiShop.com</p>
    </div>
</div>
